import Paper from '@material-ui/core/Paper';
import { Grid } from '@material-ui/core';
import Appbar from '../../shared/Appbar';
import GridTool from '../../organisms/rooms/Contents'
import React from 'react'
import Basicpagenation from '../../organisms/rooms/Roompagenation'

export default function Books(): JSX.Element{
    return(
    <div style={{paddingRight : 200, paddingLeft : 200, paddingTop:200, paddingBottom:100, color:'primary'}}>
     <Appbar/>
     <Paper variant="outlined" >
     <Grid container spacing={3} style={{alignContent:'center'} } >
      <GridTool/><GridTool/><GridTool/><GridTool/><GridTool/><GridTool/>
      </Grid>
        <Basicpagenation/>
      </Paper>
      </div>
  )
  }
